INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('4056489023838', 'Ratatouille cuisiné', '28,7% tomates, eau, 16% aubergines grillées, 16% courgettes grilles 7,8% oignons frits (oignons, huile de colza), 7% poivron (jaune rouge), 3% jus de tomates, purée de tomates, huile d\'olive vierge extra, sel, amidon de riz, ail. Traces éventuelles de céréales contenant du gluten, de crustacés, d\'euf, de poisson, de soja, de lait, de céleri, de moutarde et de mollusques. NSEILS DE PRÉPARATION: A la poêle: verser le contenu du sachet surgelé dans une poele chaude et cuire à feu vif pendant 7 à 8 minutes, puis à feu moyen endant 7 à 8 minutes, en remuant de temps en temps. four à micro-ondes : verser le contenu du sachet surgele dans ecipient avec couvercle adapté au four à micro-ondes. Cuire a watts pendant environ 8 minutes. remuer, puis cuire de dant 8 minutes. Après la cuisson, laisser reposer dans le four OO9 endant une minute. Remuer avant de servir.', 'https://static.openfoodfacts.org/images/products/405/648/902/3838/front_fr.4.400.jpg', '1.2', '0.2', '3.3', '3', '', '1.2', '0.44', '0.173228346456693', '', '1');

