INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('4056489032458', 'Filet de saumon', 'Atiantische zalm (Salmo salar) gekweekt in Faeröer.iwww.lidl.nl/verantwoordelijkheid/www.lidl.be FR/BE Filet de saumon, sans peau,pratiquement sans arêtes*, surgelé. Ingrédient: 100% filet de saumon (poisson). *Malgré toutes les précautions prises et nos contrôles très stricts, il se peut qu\'excepti - onnellement une arête subsiste dans nos produits. Conseil de décongélation: laisser décongeler les filets de saumon au réfrigérateur puis rincer à l\'eau froide et sécher délicatement Conseil de préparation: assaisonner les filets de saumon décongelés à votre convenance. Au four: préchauffer le four à 180°C (four à chaleur tournante 160°C) et cuire les filets de saumon pendant 12 à 15 minutes dans un plat graissé. A la poêle: chauffer du beurre ou de l\'huile (d\'olive) dans une poêle, puis cuire les filets de saumon à feu moyen en les retournant régulièrement pendant 6 à 8 minutes. Au gril: placer les filets de saumon sur une tranche de papier aluminium légèrement huilée. Refermer le papier aluminium et laisser griller pendant 10 minutes. Respecter les règles d\'hygiène et de sécurité des aliments. Séparer le filet de saumon cru des autres aliments. Jeter le jus de poisson. E Se laver soigneusement les mains et nettoyer les ustensiles de cuisine après chaque utilisation. Ne pas consommer cru Conservation: réfrigérateur (+7°C max.): 1 jour; *compartiment à glaçons (-6°C): 1 semaine; **congélateur (-12°C): 1 mois Ne jamais recongeler un produit décongelé. A consommer bien cuit uniquement. ***congélateur: non ouvert, à conserver à - 18°C et à consommer de préférence avant le: voir sur le côté. Saumon Atlantique (Salmo salar) élevé en lles Féroé. iwww.lidl.fr/poissons/www.lidl.be', 'https://static.openfoodfacts.org/images/products/405/648/903/2458/front_nl.4.400.jpg', '14', '1.7', '0', '0', '', '20', '0.2', '0.078740157480315', '', '1');

